import './App.css';
import Blog from './pages/Blog';

import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" component={Blog} />
        <Route path="/About" component={Blog} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
